  `kemasan` varchar(255) NOT NULL,
  `stok` double NOT NULL,
  `stok_min` double NOT NULL,
  `tgl_input` datetime NOT NULL,
  `id_pengguna` int(11) NOT NULL,
  PRIMARY KEY (`id_obat`)
) ENGINE=InnoDB AUTO_INCREMENT=217 DEFAULT CHARSET=latin1;

